import CameraCapture from "./CameraCapture"
import "./style.css";


// Appコンポーネントの定義
function App() {
  return (
    <div className="App">
      {/* ページのタイトル部分 */}
      <header>
        <h1>Capture Sketch</h1>
      </header>

      <main>
        {/* カメラのキャプチャ */}
        <CameraCapture />

        {/* UI */}
        <button>←</button>
        <button>〇</button>
        <button>→</button>
      </main>

    </div>
  );
}

// Appコンポーネントを他のファイルで利用できるようにエクスポート
export default App;
